export const checkoutActionTypes = Object.freeze({
  CHECKOUT_START_FETCHING: 'checkout/startFetching',
  CHECKOUT_STOP_FETCHING: 'checkout/stopFetching',
  CHECKOUT_SET_FETCHING_ERROR: 'checkout/setFetchingError',

  CHECKOUT_FILL: 'checkout/fill',
  CHECKOUT_SET_ACCEPT: 'checkout/setAccept',

  CHECKOUT_SEND_DATA_ASYNC: 'checkout/SEND_DATA_ASYNC',
});
